import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Register from "./pages/Register";
import SchoolRegistrationWizard from './pages/SchoolRegistrationWizard';
import SchoolDashboard from './pages/SchoolDashboard';
import PlayerProfile from "./pages/PlayerProfile";
import PlayerRegister from "./pages/PlayerRegister";
import AdminDashboard from "./pages/AdminDashboard";
import PlayerList from "./pages/PlayerList";

import "./i18n";

export default function App() {
  return (
    <Router>
      <div className="min-h-screen bg-blue-50">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />

          {/* Registration routes */}
          <Route path="/register" element={<Register />} />
          <Route path="/school-onboarding" element={<SchoolRegistrationWizard />} />
          <Route path="/register-player" element={<PlayerRegister />} />

          {/* Dashboards (role-based) */}
          <Route path="/admin" element={<AdminDashboard />} />
          <Route path="/school-dashboard" element={<SchoolDashboard />} />
          <Route path="/player/:id" element={<PlayerProfile />} />
          <Route path="/player-list" element={<PlayerList />} />

          {/* Optional: fallback route for 404 */}
          <Route path="*" element={<div className="p-8 text-center">404 Not Found</div>} />
        </Routes>
      </div>
    </Router>
  );
}
